  }
}

async function buscarDolar(url) {
  const options = { method: "GET" };

  const response = await fetch(url, options);
  const data = await response.json();
  return {
    venta: parseFloat(data.venta.replace(",", ".")),
    compra: parseFloat(data.compra.replace(",", ".")),
  };
}

